import React from "react";

const CourseRowComponent = (course, deleteCourse) => (
  <tr>
    <td>{course.name}</td>
    <td>{course.term}</td>
    <td>
      <button
        onClick={() => deleteCourse(course)} //careful!!!
        className="btn btn-info">
        Delete
      </button>
      <button className="btn btn-info">Edit</button>
    </td>
  </tr>
);

export default CourseRowComponent;
